import React from 'react';
import '../App.css'
import Button from 'react-bootstrap/Button';
import {HomeScreen} from './HomeScreen.js'
import {AboutScreen} from './AboutScreen.js'
import {ProjectsScreen} from './ProjectsScreen.js'
import {ProgressScreen} from './ProgressScreen.js'
import {Contact} from './Contact.js'

import { Sidebar } from './Sidebar';


export function MainScreen(props) {

    const [state, changeState] = React.useState()
    const [currPage, changePage] = React.useState(<HomeScreen />)
    console.log(currPage)
    function setPage() {
        switch(props.page) {
            case 'home':
                changePage(<HomeScreen/>)
                break;
            case 'about':
                changePage(<AboutScreen/>)
                break;
            case 'projects':
                changePage(<ProjectsScreen/>)
                break;
            case 'progress':
                changePage(<ProgressScreen/>)
                break;
            case 'contact':
                changePage(<Contact/>)
                break;

        }
    }


    return (
        <div
        className = 'mainScreen'
        >
            <Sidebar />
            {currPage}


        </div>



        );

}
